import * as React from 'react';
import Pikachu from '../../img/pikachu.png';
import Charmander from '../../img/charmander.png';
import {ContainerCard, ContainerPokemon , ContainerButton} from './style';
import Fab from '@mui/material/Fab';
import NavigationIcon from '@mui/icons-material/Navigation';
import AddIcon from '@mui/icons-material/Add';
import Typography from '@mui/material/Typography';
import IndeterminateCheckBoxIcon from '@mui/icons-material/IndeterminateCheckBox';
import ButtonGroup from '@mui/material/ButtonGroup';

export const CardPokemonHome = () => {

    return (
        <div>
            <ContainerCard>
                <ContainerPokemon>
                    <Typography variant="h6" gutterBottom component="div">Pikachu</Typography>
                    <img src={Pikachu} alt='Pikachu'/>
                    <ContainerButton>
                    <ButtonGroup variant="outlined" aria-label="outlined button group">
                        <Button>One</Button>
                        <Button>Two</Button>
                    </ButtonGroup>
                        <Fab variant="extended" size="small" color="secundary" aria-label="add">
                            <IndeterminateCheckBoxIcon />Detalhes
                        </Fab>
                        <Fab variant="extended" size="small" color="secundary" aria-label="add">
                            <AddIcon />Adicionar
                        </Fab>
                    </ContainerButton>
                </ContainerPokemon>
            </ContainerCard>
        </div>
    )
}
